Dr. Martin Harris (Liam Neeson) ontwaakt na een auto-ongeluk in Berlijn om te ontdekken dat zijn vrouw hem niet meer herkent en dat een andere man zijn 
identiteit heeft overgenomen. Genegeerd door ongelovige autoriteiten en opgejaagd door mysterieuze huurmoordenaars is Martin moe en alleen. Met hulp uit onverwachte hoek begint hij een avontuur, waarbij hij gaat twijfelen aan zijn geestelijke gesteldheid en zijn echte identiteit. Hoe ver zal hij gaan om de waarheid te achterhalen?

Storyline

Dr. Martin Harris (Liam Neeson) wakes up after a car accident in Berlin to discover that his wife no longer recognizes him and another man took over his 
identity. Unbelieving and ignored by authorities hunted by mysterious assassins Martin is tired and alone. With help from an unexpected corner, he begins an 
adventure in which he starts questioning his sanity and his true identity. How far will he go to the truth?



